// Calculate centered offsets
localparam H_OFFSET = 64;
localparam V_OFFSET = 112;

always @(posedge clk or posedge reset) begin
    if (reset) begin
        red_reg <= 4'b0000;
        green_reg <= 4'b0000;
        blue_reg <= 4'b0000;
    end else begin
        if (pixel_x >= H_OFFSET && pixel_x < H_OFFSET + 512 &&
            pixel_y >= V_OFFSET && pixel_y < V_OFFSET + 256) begin
            // Fetch the correct pixel from the memory
            if (main[pixel_y - V_OFFSET][511 - (pixel_x - H_OFFSET)]) begin
                red_reg <= 4'b1111;
                green_reg <= 4'b1000;
                blue_reg <= 4'b1111;
            end else begin
                red_reg <= 4'b0000;
                green_reg <= 4'b0000; // Yellow output
                blue_reg <= 4'b0000;
            end
        end else begin
            red_reg <= 4'b0000;
            green_reg <= 4'b0000;
            blue_reg <= 4'b0000;
        end
    end
end

// Assign registered values to output wires
assign red = red_reg;
assign green = green_reg;
assign blue = blue_reg;

